INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(2, 'Apertura AD8 Dobsonian', 'Mejor Valor Absoluto. Reflector de 8\" f/6. Incluye enfocador Crayford dual-speed, ventilador de refrigeración y oculares de calidad superior al promedio. Es el sucesor espiritual de los clásicos Orion SkyQuest XT8, pero con mejor equipamiento.', , 12950, 15, 'Apertura (GSO)', 'Taiwán/China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(3, 'ZWO Seestar S50', 'Disruptor Tecnológico. Telescopio inteligente \"All-in-One\". Triplete apocromático de 50mm con sensor Sony IMX462. Realiza apilado en vivo y elimina la barrera de entrada a la astrofotografía. Portabilidad extrema (2.5 kg).', , 9231.5, 8, 'ZWO', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(4, 'Celestron Origin', 'Observatorio Inteligente Premium. Diseño RASA de 6\" f/2.2. Captura fotones drásticamente más rápido que cualquier sistema convencional. Integra IA para procesamiento de imagen y sensor Sony IMX178. Representa el futuro de la marca Celestron.', , 73981.5, 10, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(5, 'Sky-Watcher Heritage 150P', 'Potencia Portátil. Dobsoniano de mesa de 150mm (6\") con tubo colapsable. Ofrece una apertura seria en un paquete que cabe en equipaje de mano. Utiliza recubrimientos Radiant™ Aluminum Quartz para mayor reflectividad.', , 6475, 9, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(6, 'Unistellar eQuinox 2', 'Especialista Urbano. Reflector de 114mm diseñado para mitigar contaminación lumínica. Carece de ocular óptico; la observación es digital vía app. Colabora con NASA en programas de ciencia ciudadana (detección de exoplanetas).', , 46231.5, 14, 'Unistellar', 'Marsella, Francia');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(7, 'Vaonis Vespera II', 'Diseño y Resolución. Cuadruplete apocromático de 50mm con sensor Sony IMX585 (8.3MP). Ofrece mosaicos automáticos para capturar objetos extensos. Su diseño \"sin botones\" prioriza la experiencia de usuario.', , 31265, 8, 'Vaonis', 'Montpellier, Francia');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(8, 'Celestron NexStar 6SE', 'El Punto Dulce. Schmidt-Cassegrain de 6\". A menudo preferido sobre el 8SE porque el tubo más ligero no sobrecarga la montura, resultando en una estabilidad superior y mejor precisión de seguimiento.', , 20331.5, 8, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(9, 'Sky-Watcher Classic 200P', 'El Clásico Indestructible. Dobsoniano de 8\". Competidor directo del Apertura AD8. Aunque sus accesorios son más básicos (enfocador simple), la calidad óptica de Synta es consistentemente alta y la disponibilidad global es superior.', , 9995, 8, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(10, 'Celestron StarSense Explorer DX 130AZ', 'Navegación Híbrida. Reflector de 130mm que usa el smartphone y un espejo para realizar \"plate solving\" y guiar al usuario manualmente a los objetos. Resuelve el problema nº1 de los principiantes: encontrar cosas.', , 8861.5, 8, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(11, 'Apertura AD10 Dobsonian', 'Profundidad de Campo. 10\" de apertura recogen un 56% más de luz que un 8\". Revela estructura en galaxias y resuelve cúmulos globulares completamente. Requiere fuerza física para moverlo, pero el rendimiento visual es estelar.', , 17575, 12, 'Apertura (GSO)', 'Taiwán/China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(12, 'Dwarflab Dwarf 3', 'Ultra-Portabilidad. Telescopio inteligente del tamaño de un diccionario. Sistema dual de lentes (periscopio). Ideal para astrofotografía de campo amplio y naturaleza diurna. Sensor Sony IMX678 Starvis 2.', , 10156.5, 10, 'Dwarflab', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(13, 'Celestron NexStar Evolution 8', 'SCT Modernizado. Mejora crítica sobre el 8SE: batería de litio de 10h, WiFi integrado y embragues manuales. La montura es mecánicamente superior, soportando mejor el peso del tubo de 8\".', , 40681.5, 10, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(14, 'Sky-Watcher Skymax 127', 'Especialista Planetario. Maksutov-Cassegrain de 127mm f/11.8. Su óptica libre de cromatismo y alto contraste lo hace un \"asesino de planetas\". Muy popular sobre monturas AZ-GTi para configuraciones portátiles.', , 11100, 10, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(15, 'Celestron Inspire 100AZ', 'Refractor de Inicio. 100mm f/6.6. Destaca por características de usabilidad: tapa de lente que funciona como soporte para móvil, luz roja integrada y enfoque de micrómetro. Buena entrada al mundo de los refractores.', , 7011.5, 10, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(16, 'Zhumell Z130	', 'Mesa Sólida. Dobsoniano de mesa de 130mm. A diferencia del Heritage, tiene tubo sólido, lo que mejora el contraste al bloquear luz parásita y mantiene la colimación mejor, aunque ocupa más espacio.', , 6475, 10, 'Zhumell', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(17, ' Celestron NexStar 4SE', 'Maksutov Compacto. 4\" (102mm). El más pequeño de la familia SE. Ideal para balcones urbanos y viajes. Su diseño Maksutov garantiza imágenes lunares muy nítidas, aunque es oscuro para cielo profundo.', , 12006.5, 10, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(18, 'Sky-Watcher Virtuoso GTi 150P', 'Dobsoniano GoTo de Mesa. Combina la óptica del Heritage 150P con una base motorizada WiFi. Permite seguimiento automático y control por app, una rareza en telescopios de mesa.', , 8695, 10, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(19, 'Celestron StarSense Explorer 8\" Dob', 'La Fusión Perfecta. Dobsoniano de 8\" clásico + tecnología StarSense. Elimina la frustración de búsqueda manual sin el costo y complejidad de motores GoTo. Base optimizada con asas de transporte.', , 14781.5, 10, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(20, 'Sky-Watcher FlexTube 300P', 'El Gigante Manejable. Dobsoniano de 12\" (305mm). Su diseño retráctil hace posible transportar una apertura masiva en coches estándar. Ofrece vistas espectaculares de nebulosas con filtros O-III.', , 27750, 10, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(21, 'Celestron Astro Fi 102', 'Maksutov WiFi. 102mm sobre montura altazimutal sin mando físico (solo app). Orientado a la generación digital. Óptica nítida en un paquete muy ligero, aunque dependiente del smartphone.', , 8676.5, 7, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(22, 'Explore Scientific FirstLight AR102', 'Refractor Clásico. Doblete acromático de 102mm. Ideal para campos estelares amplios. La montura Twilight Nano es simple pero efectiva para aprender mecánica celeste básica sin electrónica.', , 6086.5, 10, 'Explore Scientific', 'China (JOC)');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(23, 'Zhumell Z114', 'Inicio de Calidad. Dobsoniano de mesa de 4.5\". A diferencia de muchos rivales baratos, usa un espejo parabólico, garantizando enfoque nítido. El mejor punto de entrada bajo $250 USD.', , 4625, 10, 'Zhumell', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(24, 'Celestron Travel Scope 70', 'Mochilero. Refractor de 70mm ultra ligero. Incluye mochila. Óptica básica (cromatismo visible), pero su precio y peso lo hacen imbatible para senderismo o como primer telescopio para niños.', , 2035, 10, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(25, 'Sky-Watcher Heritage 130P', 'El Rey del Presupuesto. Dobsoniano colapsable de 130mm. Probablemente el telescopio más recomendado mundialmente para iniciación seria debido a su relación precio/rendimiento imbatible.', , 4995, 10, 'Sky-Watcher', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(26, 'Celestron AstroMaster 130EQ', 'El Reto. Reflector de 130mm en ecuatorial. Muy vendido en retail. Criticado por su montura compleja para novatos y araña de plástico grueso, pero capaz si se aprende a usar correctamente.', , 6475, 10, 'Celestron', 'Suzhou, China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(27, 'Celestron FirstScope 76', 'Homenaje a Newton. Mini-Dobsoniano de 76mm. Conmemorativo del Año Internacional de la Astronomía. Juguete educativo funcional, espejo esférico pero suficiente para la Luna.', , 1480, 10, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(28, 'SarBlue Mak60', 'Curiosidad Óptica. Maksutov de 60mm. Diseño de mesa con carcasa transparente. Sorprendentemente capaz en la Luna y Júpiter para su tamaño diminuto. Excelente regalo educativo.', , 2775, 10, 'SarBlue', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(29, 'Apertura AD12 Dobsonian', 'Apertura Máxima. 12 pulgadas de espejo. Solo para usuarios comprometidos (el tubo pesa casi 22kg). Bajo un cielo oscuro, muestra estructura en nebulosas que parecen manchas en telescopios menores.', , 24031.5, 10, 'Apertura', 'Taiwán/China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(30, 'Celestron StarSense Explorer LT 80AZ', 'Refractor Inteligente. 80mm. Supera al Travel Scope gracias a la guía por app StarSense y controles de movimiento lento, haciendo la experiencia de aprendizaje mucho más fluida.', , 4625, 10, 'Celestron', 'China');
INSERT INTO `Productos` (`ID_Producto`, `Nombre`, `Descripcion`, `Imagen`, `Precio`, `Cantidad`, `Fabricante`, `Origen`) VALUES
(32, 'Celestron NexStar 8SE', 'El Estándar Polivalente. Schmidt-Cassegrain de 8\" (203mm) f/10. Equilibra apertura y portabilidad. Su base de datos de 40,000 objetos y el sistema de alineación SkyAlign lo hacen accesible.', , 27731.5, 10, 'Celestron (Synta)', 'Suzhou, China');

